export const USER_DETAILS = "user_details";
export const setUserDetails = (data) => ({
    type: USER_DETAILS,
    data: data
})

export const PROJECT_DETAILS = "project_details";
export const setProjectDetails = (data) => async dispatch => {
    dispatch({
        type: PROJECT_DETAILS,
        data: data
    })
}
